import React, { useState } from "react";

const GetByPhone = function () {
  const [result, setResult] = useState("Здесь будет результат")

  function findByPhone() {
    setResult("новый результат")
  }

  return (
    <div>
      <input>
        <label>
          Номер телефона:
          <input type="text" name="phone" />
        </label>
        <input onSubmit={findByPhone} type="submit" value="Отправить" />
      </input>
      {result}

      <button onClick={findByPhone}>Plusik</button>
    </div>
  )
}

export default GetByPhone;
